type User struct {
	gorm.Model
	Name  string
	Email string
}

func (u *User) RandomData() {
	u.CreatedAt = time.Now()
	u.UpdatedAt = time.Now()
	// Random name
	letters := []rune("abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ")
	rand.Seed(time.Now().UnixNano())
	b := make([]rune, rand.Intn(11)+10) // Tên có độ dài từ 10 đến 20 ký tự
	for i := range b {
		b[i] = letters[rand.Intn(len(letters))]
	}
	u.Name = string(b)
	// Random email
	u.Email = string(b) + "@example.com"
}

type DoCommandHistory struct {
	ID             uint64    `gorm:"primaryKey;column:ID;autoIncrement:true"`
	CommandUUID    string    `gorm:"size:50;column:CommandUUID"`
	ATMID          string    `gorm:"size:12;column:ATMID"`
	StartDate      time.Time `gorm:"column:StartDate"`
	EndDate        time.Time `gorm:"column:EndDate"`
	CommandType    int       `gorm:"column:CommandType"`
	Status         int       `gorm:"column:Status"`
	Parameters     string    `gorm:"type:ntext;column:Parameters"`
	CommandResult  string    `gorm:"type:ntext;column:CommandResult"`
	DoCommandId    uuid.UUID `gorm:"column:DoCommandId"`
	TaskID         int       `gorm:"column:TaskID"`
	CommandGroupId int       `gorm:"column:CommandGroupId"`
}

func (d DoCommandHistory) TableName() string {
	return "tblDoCommandHistory"
}

